import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('resBody', () => {
    test('ok', async () => {
        const r1 = await request('https://resbody.test.whistlejs.com/?resBody=');
        expect(r1.data).toBe('body\r\nbody');
        const r2 = await request({
            url: 'https://resbody.test.whistlejs.com/?resBody=',
            method: 'post'
        });
        expect(r2.data).toBe('body\r\nbody');
    });
});
